window.bookSummaryJSON = "<p>From USA Today bestselling author Autumn Jones Lake comes the sizzling conclusion to Zero and Lilly's story.</p> <p>One by one, the lies have been unraveled. I've shed blood to protect Lilly. To protect our family. I'd do it again and again as long as it means she's safe.</p> <p>It's time to marry her, cherish her, and spend the rest of our lives together. We were so close to our happy ending. Then chaos swept it away.</p> <p>The road ahead remains unknown.</p> <p>Loyalty, honor, brotherhood. Kings forever, forever Kings.</p> <p>I'll never betray my club. Even if it means losing everything.</p> <p>Contains mature themes.</p>"; 
